pragma solidity 0.4.24;



/**
 * A simple FIFO blockstack. 
 * Enables to manage tasks inside a certain capacity 
 */

contract Stack { 

    uint256[] public strg;
    uint256 public stackPointer;
    uint256 public totalCapacity;


    constructor(uint256 _totalCapacity) public {
        totalCapacity = _totalCapacity;
    }

    function push(uint256 _size) public {
        require((stackPointer + _size) <= totalCapacity);
        strg.push(stackPointer + _size);
        stackPointer += _size;
        assert(stackPointer <= totalCapacity);
    }

    function pop() public {
        delete strg[strg.length];
        stackPointer = strg[strg.length];
    }

    function empty() public {
        for (uint i = 0; i <= strg.length; i++){
            pop();
        }
        assert(strg.length == 0);
    }

    function slotSize() public returns (uint256){
        return strg.length;
    }

    function onSlot(uint256 slotNumber, uint256 blockNumber) public returns (bool) {
        return (blockNumber >= strg[slotNumber-1] && blockNumber <= strg[slotNumber]);
    }

}
